DROP TABLE IF EXISTS `tb_serve_maintenance_bak`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `tb_serve_maintenance_bak` (
  `id` int(11) NOT NULL DEFAULT '0' COMMENT '单据ID',
  `m_code` varchar(500) CHARACTER SET utf8 NOT NULL COMMENT '单据编号',
  `c_id` int(11) DEFAULT NULL COMMENT '客户ID',
  `e_id` int(11) DEFAULT NULL COMMENT '设备ID',
  `repair_content` varchar(500) CHARACTER SET utf8 DEFAULT NULL COMMENT '报修内容',
  `service_engineer` varchar(256) CHARACTER SET utf8 DEFAULT NULL COMMENT '服务工程师',
  `service_date` date DEFAULT NULL COMMENT '服务日期',
  `gear_speed` double DEFAULT NULL COMMENT '齿轮速比',
  `work_times` double DEFAULT NULL COMMENT '运转时数',
  `exhaust_pressure` double DEFAULT NULL COMMENT '排气压力(MPa)',
  `exhaust_temperature` double DEFAULT NULL COMMENT '排气温度(°C)',
  `env_temperature` double DEFAULT NULL COMMENT '环境温度(°C)',
  `oil_pressure` double DEFAULT NULL COMMENT '油压(MPa)',
  `running_voltage` double DEFAULT NULL COMMENT '运转电压(V)',
  `running_elec` double DEFAULT NULL COMMENT '运转电流(A)',
  `fault_reason` varchar(500) CHARACTER SET utf8 DEFAULT NULL COMMENT '故障原因',
  `service_content` varchar(500) CHARACTER SET utf8 DEFAULT NULL COMMENT '服务内容',
  `service_other_content` varchar(256) CHARACTER SET utf8 DEFAULT NULL COMMENT '其他服务内容',
  `engineer_suggest` varchar(500) CHARACTER SET utf8 DEFAULT NULL COMMENT '服务工程师建议',
  `service_fees` double DEFAULT NULL COMMENT '服务费用',
  `c_view` varchar(500) CHARACTER SET utf8 DEFAULT NULL,
  `note` varchar(2000) CHARACTER SET utf8 DEFAULT NULL COMMENT '备注',
  `creator` int(11) DEFAULT NULL COMMENT '单据创建人',
  `created` datetime DEFAULT NULL COMMENT '创建时间',
